import React from 'react'; 
import SocialItem from './SocialItem';

function Social(){
    return(
        <ul className="list-group">
           
            <SocialItem
                 media='Facebook'
                 id='facebook'
                 img='./facebook.png'
            />
            <SocialItem 
                 media='Youtube' 
                 id='youtube' 
            />
            <SocialItem 
                 media='Instagram' 
                 id='instagram' 
            />
            <SocialItem 
                 media='LinkedIn' 
                 id='linkedIn' 
            />


           
        </ul>
    );
}

export default Social;
